import { Component } from 'react';
import Room from './Room';
import axios from 'axios';


export default class Rooms extends Component {


    constructor(props) {
        super(props);
        this.state = { rooms: [] }
    }


    render() {
        return (
            <div className="row" >
                {this.state.rooms.map(room => {
                    return (
                        <Room
                            code={room}
                        >
                        </Room>
                    )
                })}
            </div>
        )
    }
}
